import React from 'react'
import './Ride.css'
import Popup from 'reactjs-popup';
import { useNavigate } from 'react-router-dom'
import NavBar from './NavBar';

export default function RideHistory() {
  const navigate = useNavigate()
  const myHistory = [
    { id: 1, pickup: '123 Apple Street', dropoff: '456 Banana Road', vehicle: 'car', date: 'September 1, 2024 07:14:00' },
    { id: 1, pickup: '456 Banana Road', dropoff: '123 Apple Street', vehicle: 'car', date: 'September 1, 2024 12:03:00' },
    { id: 1, pickup: '123 Apple Street', dropoff: '1515 George Mason Avenue', vehicle: 'truck', date: 'September 5, 2024 08:34:00' }
  ]

  const onCancelClick = () => {
    navigate('/home');
  }

  const onOKClick = () => {
    navigate('/home');
  }


  return (
    <div className={'mainContainer'}>
      <NavBar />
      <div className={'contentContainer'}>
        {
          myHistory.map(e => {
            return (
              <div className={'historyContainer'}>
                <p>From: "{e.pickup}" To: "{e.dropoff}" Vehicle: {e.vehicle} Date: {e.date.toLocaleString('en-US', {
                  day: '2-digit',
                  month: '2-digit',
                  year: 'numeric'
                })}</p>
                <Popup trigger=
                  {<button>Report Issue</button>}
                  modal nested className={'modal'}>
                  <p>From: {e.pickup}</p>
                  <p>To: {e.dropoff}</p>
                  <p>Vehicle: {e.vehicle}</p>
                  <p>Date: {e.date.toLocaleString(
                    'en-US', {
                    day: '2-digit',
                    month: '2-digit',
                    year: 'numeric'
                  })}
                  </p>
                  <label for="message">Please tell us about the issue:</label>
                  <textarea name="message" type="text" />
                  <div className={'submitContainer'}>
                    <button onClick={onCancelClick} >Cancel</button>
                    <button onClick={onOKClick}>Submit</button>
                  </div>
                </Popup>
              </div>
            )
          })
        }
      </div>
    </div>
  )
}
